  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Chautauqua NWR
  outlines Refuge accomplishments from November, 1941 to January, 1942. The report
  begins by summarizing the weather conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments and collections and receipts.
  Resource management is outlined; topics include commercial fishing. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes fishing and violations. Photographs are attached.\",\n\t\"owner_org\":
